INSERT INTO public.course_sections (id, name, course_id, video_link, order_index, description) VALUES (3, 'Lesson 1: Fundamentals of Valorant Mechanics', 12, 'https://www.youtube.com/watch?v=rNeMG3LoIRw', 1, 'In this lesson, you''ll master the essential mechanics of Valorant, including movement, crosshair placement, and recoil control. Understanding these basics will set the foundation for improving your aim, reaction time, and in-game decision-making. Get ready to elevate your gameplay! ');
INSERT INTO public.course_sections (id, name, course_id, video_link, order_index, description) VALUES (4, 'Lesson 2: Advanced Crosshair Placement', 12, 'https://www.youtube.com/watch?v=a4WMbmXZbTU', 1, 'Master the art of crosshair placement to gain a competitive edge in every duel. Learn how to position your crosshair for maximum accuracy, minimize reaction time, and consistently land headshots. This lesson covers pre-aiming, peeking techniques, and effective crosshair discipline to help you dominate your opponents.');
INSERT INTO public.course_sections (id, name, course_id, video_link, order_index, description) VALUES (5, 'Lesson 3: Stay Hard – Building Mental Toughness', 12, 'https://www.youtube.com/watch?v=Y6uoJA8us0g&t=1584s', 1, 'Success in Valorant isn’t just about aim—it’s about mindset. In this lesson, you’ll learn how to stay focused under pressure, overcome tilt, and maintain a winning mentality even in tough matches. We’ll cover resilience, emotional control, and strategies to stay disciplined, so you can perform at your peak no matter the situation.');
INSERT INTO public.course_sections (id, name, course_id, video_link, order_index, description) VALUES (7, 'OST Bát hoang quyết', 2, 'https://www.youtube.com/watch?v=2LYlVN1Uxnc&list=RDzfks25wtGqE&index=3', 1, 'Full trailer bản chính thức và DLC mới free 1 tuần của Quỷ Cốc Bát Hoang | Tale of Immortal | 鬼谷八荒');
INSERT INTO public.course_sections (id, name, course_id, video_link, order_index, description) VALUES (8, '[Official Soundtrack] Tale of Immortal - Official Launch Trailer - 八荒诀纯音版', 2, 'https://www.youtube.com/watch?v=zfks25wtGqE&list=RDzfks25wtGqE&index=1', 0, '『纵一苇之所如，凌万顷之茫然。浩浩乎如冯虚御风，而不知其所止；飘飘乎如遗世独立，羽化而登仙』——《前赤壁赋》');
INSERT INTO public.course_sections (id, name, course_id, video_link, order_index, description) VALUES (9, 'Reading and Listening Outcomes of Learners in the Duolingo English Course for Portuguese Speakers', 14, '', 1, 'This study evaluated the reading and listening proficiency levels of 92 English language learners who completed the Basic content (CEFR A2) of the Duolingo English course for Portuguese speakers. The participants self-reported having little to no prior proficiency in English and using Duolingo as their only learning tool. Their language skills were assessed with the reading and listening sections of the STAMP 4S English test by Avant Assessment. The results show that, on average, learners at the end of A2 scored Intermediate High in reading and Intermediate Mid in listening on the ACTFL proficiency scale. These findings are almost identical to previous findings for an analogous group of learners in the Duolingo English course for Spanish speakers (Jiang & Pajak, 2022), thus providing further evidence of effectiveness of Duolingo English courses in developing learners’ reading and listening comprehension skills');
INSERT INTO public.course_sections (id, name, course_id, video_link, order_index, description) VALUES (10, 'The effects of frequency, duration, and intensity on L2 learning through Duolingo: A ‘natural’ experiment', 14, '', 1, 'Second-language (L2) development is greatly influenced by the type and amount of instruction that learners receive (e.g., Norris & Ortega, 2000; Saito & Plonsky, 2019). Less clear, however, are the effects of frequency, duration, and intensity of target language exposure and practice. That is, are intensive periods of instruction (i.e., “massed learning”) most effective, or is instruction more effective through more frequent (i.e., “spaced”) exposure (see Carpenter, 2020; Rogers & Cheung, 2021)? Informed by a quickly growing body of research in second-language acquisition (SLA) that has sought to address this question (e.g., Kasprowicz et al., 2019; Li & DeKeyser, 2019), the present study builds on these and other recent studies of distributed learning in SLA (e.g., Serrano & Huang, 2018; Suzuki & DeKeyser, 2017) as well as several decades of theoretical and empirical attention in educational psychology (see Carpenter, 2020; Rohrer, 2015) to shed light on the effects of frequency and duration of Duolingo app usage on L2 learning. In doing so, the study seeks to make several unique and worthwhile contributions.');
INSERT INTO public.course_sections (id, name, course_id, video_link, order_index, description) VALUES (11, 'Let''s get started', 20, 'https://www.youtube.com/watch?v=h7yASn8cpOw', 1, 'Mog the Mogger');
