INSERT INTO public.courses (id, name, author, description, thumbnail, price) VALUES (16, 'The Art of War', 'Sun Tzu', 'A striking embodiment of strategy, power, and the relentless pursuit of victory, The Art of War captures the essence of conflict—both on the battlefield and within the mind. With bold strokes and calculated composition, this artwork evokes the tension of an imminent clash, where intellect and strength intertwine in a dance of dominance.  Shadows and light wage their own silent war, symbolizing the eternal struggle between chaos and order, aggression and restraint. Each detail tells a story of cunning, resilience, and the weight of decisions that shape destinies. Whether inspired by the ancient treatise of Sun Tzu or the broader philosophy of warfare, The Art of War stands as a testament to the mastery of tactics, the discipline of warriors, and the artistry of battle itself.', '\', NULL);
