INSERT INTO public.courses (id, name, author, description, thumbnail, price) VALUES (19, 'The Prince ', 'Machiavelli', 'The Prince (Italian: Il Principe [il ˈprintʃipe]; Latin: De Principatibus) is a 16th-century political treatise written by the Italian diplomat, philosopher, and political theorist Niccolò Machiavelli in the form of a realistic instruction guide for new princes. The Prince shocked many readers by assuming that immoral acts are justifiable if they achieve political glory.', '\', NULL);
INSERT INTO public.courses (id, name, author, description, thumbnail, price) VALUES (20, 'Gym Mogger ', 'David Laid', 'Unlock your ultimate physique and mindset with Gym Mogger, a transformational fitness program designed by influencer, bodybuilder, and entrepreneur David Laid. This course is more than just a workout guide — it’s a deep dive into the strategies, habits, and philosophy that helped David go from a skinny teenager to a global fitness icon.  Through a series of structured training modules, nutrition plans, and personal insights, Gym Mogger equips you with the tools to build lean muscle, boost confidence, and master your personal brand in the fitness world.', '\', NULL);
