', '\', 6.00);
INSERT INTO public.courses (id, name, author, description, thumbnail, price) VALUES (12, 'Grind Valorant Rank cùng LastHopeDaNang', 'The Undeniable goat ', 'Join the Grind Valorant Rank course with LastHopeDaNang to level up your skills and climb the ranks faster! Learn to optimize your aim, team strategies, competitive mindset, and exclusive tips to achieve your desired rank. Conquer Valorant with LastHopeDaNang today! 🚀🔥', '\', 10.00);
